const require_utils = require('../../../feeds/atom/parse/utils.cjs');

//#region src/namespaces/atom/parse/utils.ts
const retrieveEntry = (value) => {
	return require_utils.parseEntry(value, {
		prefix: "atom:",
		asNamespace: true
	});
};
const retrieveFeed = (value) => {
	return require_utils.parseFeed(value, {
		prefix: "atom:",
		asNamespace: true
	});
};

//#endregion
exports.retrieveEntry = retrieveEntry;
exports.retrieveFeed = retrieveFeed;